"Metronome Connect" is a metronome application with a connection function for synchronous playback on multiple devices.

Main functions:
- Saving presets;
- Unlimited playlists;
- Set the tempo using the microphone;
- Creating a clicktrack with different tempos and sizes, there is a slowdown / acceleration;
- Print playlist;
- Built-in tuner;
- Synchronization of presets in iCloud;
- Ability to upload your own metronome sounds;
- Polyrhythm.

Happy using! ;)
